    {ntt"total": 113,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2013-03-15T16:36:30.301940",nt"name": "oil-and-gas-exploration-and-production-in-the-state-of-ohio-shown-as-quarter-mile-cells",nt"isopen":
    false,nt"url": null,nt"notes": "A cells polygon feature class was created
    by the U.S. Geological Survey (USGS) to illustrate the degree of exploration, type
    of production, and distribution of production in the State of Ohio. Each cell represents
    a quarter-mile square of the land surface, and the cells are coded to represent
    whether the wells included within the cell are predominantly oil-producing, gas-producing,
    both oil and gas-producing, or the type of production of the wells located within
    the cell is unknown or dry. The well information was acquired from the Ohio Department
    of Natural Resources, Division of Geological Survey in a Geographic Information
    System (GIS) data layer that contains all of the locatable oil and gas wells in
    Ohio. Cells were developed as a graphic solution to overcome the problem of displaying
    proprietary well data. No proprietary data are displayed or included in the cell
    maps. The data are current as of 2004.",nt"license_title": null,nt"extras":
